import React from 'react'

import SubMenuContainer from './SubMenuContainer/SubMenuContainer'
import MenuCard from './MenuCard/MenuCard';

import './dish-container.css';

function DishContainer() {
    return (
        <div className="dishContainer">
            <div className="menuCard">
                <SubMenuContainer name={"Categoria do Cardápio"} />
            </div>
            <div className="rowContainer">
                <div>
                    <MenuCard imgSrc={"https://firebasestorage.googleapis.com/v0/b/food-delivery-37c59.appspot.com/o/Images%2Fburger1.png?alt=media&token=319dfbe9-46ea-8f38-6ca7a20319e0"}
                        name={"Burger"} />
                </div>

                <div>
                    <MenuCard imgSrc={"https://firebasestorage.googleapis.com/v0/b/food-delivery-37c59.appspot.com/o/Images%2Fburger1.png?alt=media&token=319dfbe9-46ea-8f38-6ca7a20319e0"}
                        name={"Burger"} />
                </div>

                <div>
                    <MenuCard imgSrc={"https://firebasestorage.googleapis.com/v0/b/food-delivery-37c59.appspot.com/o/Images%2Fburger1.png?alt=media&token=319dfbe9-46ea-8f38-6ca7a20319e0"}
                        name={"Burger"} />
                </div>
            </div>
            <div className="dishitemContainer"></div>
        </div>
    )
}

export default DishContainer
